func isIn(i int, s []int) bool {
	for _, v := range s {
		if i == v {
			return true
		}
	}
	return false
}

func removeDupes(s []int) []int {
	news := make([]int, len(s))

	i := 0
	for _, v := range s {
		if !isIn(v, news) {
			news[i] = v
			i++
		}
	}

	return news
}

func main() {
	for _, s := range alikes {
		sort.Ints(s)
	}

	for _, s := range alikes {
		s = removeDupes(s)
	}

	for i, s := range alikes {
		switch i {
		case 0:
			fmt.Printf("//Lowercase:\n")
		case 26:
			fmt.Printf("//Uppercase:\n")
		case 52:
			fmt.Printf("//Numbers:\n")
		case 62:
			fmt.Printf("//Whitespaces\n")
		}
		fmt.Printf(
			"%s,\n",
			fmt.Sprintf("%#v", s)[5:],
		)
	}
}
